import React from 'react'

class User extends React.Component {
	constructor() {
		super();
	}

	render() {
		return <div>
			<table className="table">
                <thead>
                    <tr>
                       <td>Name</td>
                       <td>Surname</td>
                       <td>Surname</td>
                       <td>Days</td>
                    </tr>
                </thead>
                <tr>
                    <td>{this.props.name}</td>
                    <td>{this.props.surname}</td>
                    <td>{this.props.salary}</td>
                    <td>{this.props.days}</td>
                </tr>
            </table>
		</div>;
	}
}


export default User;
